$(document).ready(function() {
  "use strict";

  if (annyang) {
    // Define the functions our commands will run.
    var hello = function() {
      var msg = new SpeechSynthesisUtterance('Hello user. WHat can I do for you?');
      window.speechSynthesis.cancel();
      window.speechSynthesis.speak(msg);
    };
    var goto = function(page) {
      var selector = 'a[data-annyang="' + page + '"]';
      var matches = $(selector);

      if (matches.length === 1) {
        matches.trigger('click');
      }
      else {
        var msg = new SpeechSynthesisUtterance("Sorry, I don't understand you");
        window.speechSynthesis.cancel();
        window.speechSynthesis.speak(msg);
      }
    };
    var add_item = function(item) {
      var selector = 'button[data-annyang="add ' + item + '"]';
      var matches = $(selector);

      if (matches.length === 1) {
        matches.trigger('click');
      }
      else {
        var msg = new SpeechSynthesisUtterance("Sorry, I don't understand you");
        window.speechSynthesis.cancel();
        window.speechSynthesis.speak(msg);
      }
    };
    var save_modal = function() {
      $('.modal.in').find('button[type="submit"]').trigger('click');
    };
    var cancel_modal = function() {
      $('.modal.in').modal('hide');
    };
    var annyang_events = function() {
      var text = 'No events for today';
      var msg;

      $.getJSON('events', function(events) {
        if (events) {
          text = events;
        }
        msg = new SpeechSynthesisUtterance(text);
        window.speechSynthesis.cancel();
        window.speechSynthesis.speak(msg);
      });
    };
    var annyang_time = function() {
      var currentdate = new Date();
      var msg = currentdate.getHours() + ' hours and ' + currentdate.getMinutes() + ' minutes';

      msg = new SpeechSynthesisUtterance(msg);
      window.speechSynthesis.cancel();
      window.speechSynthesis.speak(msg);
    };
    var annyang_stop = function() {
      annyang.abort();
      var msg = new SpeechSynthesisUtterance('Goodbye!');
      window.speechSynthesis.cancel();
      window.speechSynthesis.speak(msg);
    };
    // define our commands.
    // * The key is the phrase you want your users to say.
    // * The value is the action to do.
    //   You can pass a function, a function name (as a string), or write your function as part of the commands object.
    var commands = {
      'hello (there)':        hello,
      'go to *page':          goto,
      'add *item':            add_item,
      'save':                 save_modal,
      'cancel':               cancel_modal,
      'today\'s events':      annyang_events,
      'what time is it':      annyang_time,
//      'play me something':    annyang_paly,
      'goodbye':              annyang_stop,
    };
    // OPTIONAL: activate debug mode for detailed logging in the console
    annyang.debug();
    // Add voice commands to respond to
    annyang.addCommands(commands);
    // OPTIONAL: Set a language for speech recognition (defaults to English)
    // For a full list of language codes, see the documentation:
    // https://github.com/TalAter/annyang/blob/master/docs/FAQ.md#what-languages-are-supported
    annyang.setLanguage('en');
    // Tell KITT to use annyang
    SpeechKITT.annyang();

    // Render KITT's interface
    SpeechKITT.vroom();
  }
});

$(document).ready(function() {
  "use strict";

  // Set up and initialize editable.
  $.fn.editable.defaults.mode = 'inline';

  var $content = $('#content');

  function set_active_link(link) {
    var a_selector = 'a[href="' + link + '"]';
    var $link = $(a_selector);
    $('li.active > a').parent().removeClass('active');
    $link.parent('li').addClass('active');
  }

  function page_init() {
    // Initialize datetimepicker.
    $content.find('.datetimepicker').datetimepicker({
      format: 'YYYY-MM-DD HH:mm',
    });
    $content.find('.datetimepicker-date').datetimepicker({
      format: 'YYYY-MM-DD',
    });

    // Initialize jscolor.
    jscolor.installByClassName('jscolor');
  }

  // Process ajax links.
  $(document).on('click', 'a.ajax-link', function(event) {
    event.preventDefault();
    if (!$(this).parent('li').hasClass("active")) {
      var $link = $(this);
      $.ajax({
        url: $link.attr("href") != '/' ? '/ajax' + $link.attr("href") : '/ajax',
        dataType: 'html',
      })
      .done(function(data) {
        $('#content').html(data);
        set_active_link($link.attr("href"));
        page_init();
        $(".modal-backdrop.in").remove();
        history.pushState({content: data}, null, $link.attr("href"));
      })
      .fail(function() {
        window.location.replace($link.attr("href"));
      });
    }
  });

  // Back button.
  $(window).on('popstate', function(event) {
    if (event.originalEvent.state.content !== null) {
      $('#content').html(event.originalEvent.state.content);
      set_active_link(window.location.pathname);
    }
  });

  // Show from if there are errors.
  $('.modal.error').modal('show');

  // Clean modal form on close.
  $(document).on('hidden.bs.modal', '.modal', function () {
    var $modal = $(this);

    // Clean inputs (but not security token) and textareas.
    $modal.find("input:not([name='csrfmiddlewaretoken']), textarea").val('');
    // Clean selects and select2.
    $modal.find('select').prop('selectedIndex', 0).trigger('change.select2');
    $modal.find('.btn.delete').hide();
    $modal.find('form [role="alert"]').remove();
    $modal.find('.form-group').show();
    $modal.find('#id_progress').parents('.form-group').hide();
    $modal.find('#id_resolution').parents('.form-group').hide();

    // Clean ckeditors.
    if (typeof CKEDITOR !== 'undefined') {
      for (var i in CKEDITOR.instances) {
        // Check if the textarea still exists.
        if ($modal.find($(CKEDITOR.instances[i].element['$'])).length) {
          CKEDITOR.instances[i].setData('');
        }
      }
    }
  });

  // Show modal edit form.
  $(document).on('click', 'a.edit', function() {
    var $card = $(this).closest('.card-container, .item-container');
    var $modal = $card.closest('#content').find('.modal');
    var $field;
    var card = $card.data('json');
    var key;

    // Show modal, remove errors and set hidden id field.
    $modal.modal();
    $modal.find('.alert').remove();
    $modal.find('#id_id').val(card.pk);
    $modal.find('.btn.delete').show();

    // Update all fields.
    for (key in card.fields) {
      $field = $modal.find('#id_' + key);
      $field.val(card.fields[key]);

      if ($field.is('textarea.ckeditor')) {
        // We need update ckeditor too.
        if ('id_' + key in CKEDITOR.instances) {
            CKEDITOR.instances['id_' + key].setData(card.fields[key]);
        }
      }
      else if ($field.is('select')) {
        // We need update select2 too.
        $field.trigger('change.select2');
      }

      // For Task we need to show/hide resolution and progress fields.
      if (card.model === 'tool.task') {
        if ((card.fields['status'] === 'done' && key === 'resolution') ||
            (card.fields['status'] === 'doing' && key === 'progress')) {
          $field.parents('.form-group').show();
        }
      }

      if (key === 'color' && $field.is('input[type=text]')) {
        $field[0].jscolor.importColor(card.fields[key]);
      }
    }

    return false;
  });

  // Flashcards.
  $(document).on('click', '.flip', function() {
    $(this).find('.card').toggleClass('flipped');
  });

  // Initialize datetimepicker and jscolor.
  page_init();

});
